import { createContext, useState } from "react";

const initialState = {
    user: 'pepito',
    pass: 'pepito',
}

export const userContext = createContext({} as any);

export const UserContextProvider = ({children} :any) => {

    const [user, setUser] = useState(initialState);

    return (
        <userContext.Provider
            value={{user, setUser}}
        >
            {children}
        </userContext.Provider>
    )
}
